selector_to_html = {"a[href=\"#tropy-explode\"]": "<figure class=\"align-default\" id=\"tropy-explode\">\n<a class=\"reference internal image-reference\" href=\"../../_images/tropy-explode.png\"><img alt=\"../../_images/tropy-explode.png\" src=\"../../_images/tropy-explode.png\" style=\"width: 600px;\"/></a>\n<figcaption>\n<p><span class=\"caption-number\">Fig. 28.20 </span><span class=\"caption-text\">Choose \u2018Explode\u2019 from the item menu</span><a class=\"headerlink\" href=\"#tropy-explode\" title=\"Link to this image\">#</a></p>\n</figcaption>\n</figure>", "a[href=\"#install-the-iiif-trove-import-template\"]": "<h3 class=\"tippy-header\" style=\"margin-top: 0;\">Install the IIIF Trove import template<a class=\"headerlink\" href=\"#install-the-iiif-trove-import-template\" title=\"Link to this heading\">#</a></h3><p>Tropy uses templates to control how metadata is displayed. You can create new templates to meet the needs of particular projects, collection sources, or format types. I\u2019ve created an \u2018IIIF Trove import\u2019 template that maps Trove fields to Tropy vocabularies.</p>", "a[href=\"#saving-a-trove-collection-as-an-iiif-manifest\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Saving a Trove collection as an IIIF manifest<a class=\"headerlink\" href=\"#saving-a-trove-collection-as-an-iiif-manifest\" title=\"Link to this heading\">#</a></h2><p>The first step in importing Trove data into Tropy is to save the data in a format that Tropy understands. Tropy has plugins that enable it to import data from CSV files and IIIF manifests. You can save a Trove collection as an IIIF manifest using <a class=\"reference external\" href=\"https://glam-workbench.net/trove-images/save-image-collection-iiif/\">this noteboook</a> in the GLAM Workbench.</p>", "a[href=\"#identifying-a-collection-in-trove\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Identifying a collection in Trove<a class=\"headerlink\" href=\"#identifying-a-collection-in-trove\" title=\"Link to this heading\">#</a></h2><p>The first thing you need is a collection to harvest! More specifically, you need to find a collection\u2019s landing page in Trove\u2019s digitised collection viewer. Once you\u2019ve found the collection page, you can copy its <code class=\"docutils literal notranslate\"><span class=\"pre\">nla.obj</span></code> identifier.</p>", "a[href=\"#collection-cite-identifier\"]": "<figure class=\"align-default\" id=\"collection-cite-identifier\">\n<a class=\"reference internal image-reference\" href=\"../../_images/collection-cite-identifier.png\"><img alt=\"../../_images/collection-cite-identifier.png\" src=\"../../_images/collection-cite-identifier.png\" style=\"width: 600px;\"/></a>\n<figcaption>\n<p><span class=\"caption-number\">Fig. 28.4 </span><span class=\"caption-text\">Clicking on the <strong>Cite</strong> button reveals the collection\u2019s identifier.</span><a class=\"headerlink\" href=\"#collection-cite-identifier\" title=\"Link to this image\">#</a></p>\n</figcaption>\n</figure>", "a[href=\"#using-the-notebook-in-jupyter-lab\"]": "<h3 class=\"tippy-header\" style=\"margin-top: 0;\">Using the notebook in Jupyter Lab<a class=\"headerlink\" href=\"#using-the-notebook-in-jupyter-lab\" title=\"Link to this heading\">#</a></h3><p>No matter what service you use to run the notebook, the result will be the same \u2013 the notebook will open in the Jupyter Lab interface.</p>", "a[href=\"#saving-and-sharing-your-research\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Saving and sharing your research<a class=\"headerlink\" href=\"#saving-and-sharing-your-research\" title=\"Link to this heading\">#</a></h2><p>It\u2019s always important to think about what happens to your data at the end of a project. Tropy helps you save and share your research by providing a variety of export options.</p><p>From the \u2018File\u2019 menu, choose \u2018Export\u2019 to save your data as a JSON-LD file. This file saves all your metadata, annotations, and notes in a structured, machine-readable format. Saving this to an approprate repository will help document and preserve your research process and provide signposts for other researchers. Your can also export your work to a PDF file.</p>", "a[href=\"#tropy-plugins\"]": "<figure class=\"align-default\" id=\"tropy-plugins\">\n<a class=\"reference internal image-reference\" href=\"../../_images/tropy-plugins.png\"><img alt=\"../../_images/tropy-plugins.png\" src=\"../../_images/tropy-plugins.png\" style=\"width: 600px;\"/></a>\n<figcaption>\n<p><span class=\"caption-number\">Fig. 28.14 </span><span class=\"caption-text\">The Tropy plugins page with the IIIF plugin installed and enabled.</span><a class=\"headerlink\" href=\"#tropy-plugins\" title=\"Link to this image\">#</a></p>\n</figcaption>\n</figure>", "a[href=\"#finding-collection-pages\"]": "<h3 class=\"tippy-header\" style=\"margin-top: 0;\">Finding collection pages<a class=\"headerlink\" href=\"#finding-collection-pages\" title=\"Link to this heading\">#</a></h3><p>&lt;\u2013 see also link to GW list of finding aids? \u2013&gt;</p><p>Trove groups digitised resources into collections of different shapes and sizes. Here are some examples:</p>", "a[href=\"#tropy-templates\"]": "<figure class=\"align-default\" id=\"tropy-templates\">\n<a class=\"reference internal image-reference\" href=\"../../_images/tropy-templates.png\"><img alt=\"../../_images/tropy-templates.png\" src=\"../../_images/tropy-templates.png\" style=\"width: 600px;\"/></a>\n<figcaption>\n<p><span class=\"caption-number\">Fig. 28.16 </span><span class=\"caption-text\">Click on the import symbol to install a new template.</span><a class=\"headerlink\" href=\"#tropy-templates\" title=\"Link to this image\">#</a></p>\n</figcaption>\n</figure>", "a[href=\"#organising-trove-collections-in-tropy\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Organising Trove collections in Tropy<a class=\"headerlink\" href=\"#organising-trove-collections-in-tropy\" title=\"Link to this heading\">#</a></h2><p>Tropy provides a number of mechanisms for organising the contents of your imported collections, so your research is no longer bound by Trove\u2019s descriptive framework. One thing to note, however, is that the whole IIIF manifest is imported into Tropy as a single \u2018Item\u2019, with individual images grouped as \u2018Photos\u2019 within that item. This limits your options for re-organising images. Fortunately, there\u2019s a quick solution. Right click on the manifest \u2018Item\u2019 and choose \u2018Explode\u2019 from the menu.</p>", "a[href=\"../../understanding-search/finding-digitised-content.html\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\"><span class=\"section-number\">11. </span>Finding NLA digitised content you can download<a class=\"headerlink\" href=\"#finding-nla-digitised-content-you-can-download\" title=\"Link to this heading\">#</a></h1><p>Trove provides a platform for the delivery of digitised content from the National Library of Australia and its partners. This digitised content is easy to find in the <em>Newspapers &amp; gazettes</em> and <em>Magazines &amp; newsletters</em> categories \u2013 they\u2019re full of it! But it\u2019s not so easy to find digitised content in other categories where it\u2019s mixed with works aggregated from a range of different sources.</p><p>There are a few different approaches to finding digitised content, but they all have potential problems. While I highlight what I think is the most reliable option, it\u2019s really a matter of working out what will best meet your research needs.</p>", "a[href=\"#tools-and-standards\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Tools and standards<a class=\"headerlink\" href=\"#tools-and-standards\" title=\"Link to this heading\">#</a></h2>", "a[href=\"#tropy-import-iiif\"]": "<figure class=\"align-default\" id=\"tropy-import-iiif\">\n<a class=\"reference internal image-reference\" href=\"../../_images/tropy-import-iiif.png\"><img alt=\"../../_images/tropy-import-iiif.png\" src=\"../../_images/tropy-import-iiif.png\" style=\"width: 600px;\"/></a>\n<figcaption>\n<p><span class=\"caption-number\">Fig. 28.19 </span><span class=\"caption-text\">Select File &gt; Import &gt; IIIF import</span><a class=\"headerlink\" href=\"#tropy-import-iiif\" title=\"Link to this image\">#</a></p>\n</figcaption>\n</figure>", "a[href=\"#iiif-manifests-folder\"]": "<figure class=\"align-default\" id=\"iiif-manifests-folder\">\n<a class=\"reference internal image-reference\" href=\"../../_images/iiif-manifests-folder.png\"><img alt=\"../../_images/iiif-manifests-folder.png\" src=\"../../_images/iiif-manifests-folder.png\" style=\"width: 600px;\"/></a>\n<figcaption>\n<p><span class=\"caption-number\">Fig. 28.12 </span><span class=\"caption-text\">Double click to open the folder</span><a class=\"headerlink\" href=\"#iiif-manifests-folder\" title=\"Link to this image\">#</a></p>\n</figcaption>\n</figure>", "a[href=\"#tropy-template-details\"]": "<figure class=\"align-default\" id=\"tropy-template-details\">\n<a class=\"reference internal image-reference\" href=\"../../_images/tropy-template-details.png\"><img alt=\"../../_images/tropy-template-details.png\" src=\"../../_images/tropy-template-details.png\" style=\"width: 600px;\"/></a>\n<figcaption>\n<p><span class=\"caption-number\">Fig. 28.17 </span><span class=\"caption-text\">The IIIF Trove import template installed in Tropy.</span><a class=\"headerlink\" href=\"#tropy-template-details\" title=\"Link to this image\">#</a></p>\n</figcaption>\n</figure>", "a[href=\"#working-with-a-trove-collection-in-tropy\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\">Working with a Trove collection in Tropy<a class=\"headerlink\" href=\"#working-with-a-trove-collection-in-tropy\" title=\"Link to this heading\">#</a></h1><p>You want to be able to work on a collection of digitised images from Trove on your desktop \u2013 adding notes, transcriptions, and annotations. <a class=\"reference external\" href=\"https://tropy.org/\">Tropy</a> is a useful tool for managing collections of research images, but how do you import a collection of images from Trove into Tropy? This tutorial walks through one possible method.</p>", "a[href=\"#id1\"]": "<figure class=\"align-default\" id=\"id1\">\n<a class=\"reference internal image-reference\" href=\"../../_images/ardc-binder-aaf-login.png\"><img alt=\"../../_images/ardc-binder-aaf-login.png\" src=\"../../_images/ardc-binder-aaf-login.png\" style=\"width: 600px;\"/></a>\n<figcaption>\n<p><span class=\"caption-number\">Fig. 28.7 </span><span class=\"caption-text\">ARDC Binder will ask you to log in using AAF</span><a class=\"headerlink\" href=\"#id1\" title=\"Link to this image\">#</a></p>\n</figcaption>\n</figure>", "a[href=\"#gw-iiif-nb\"]": "<figure class=\"align-default\" id=\"gw-iiif-nb\">\n<a class=\"reference internal image-reference\" href=\"../../_images/gw-iiif-nb.png\"><img alt=\"../../_images/gw-iiif-nb.png\" src=\"../../_images/gw-iiif-nb.png\" style=\"width: 600px;\"/></a>\n<figcaption>\n<p><span class=\"caption-number\">Fig. 28.6 </span><span class=\"caption-text\">The GLAM Workbench provides a number of ways you can run the notebook.</span><a class=\"headerlink\" href=\"#gw-iiif-nb\" title=\"Link to this image\">#</a></p>\n</figcaption>\n</figure>", "a[href=\"#aaf-institutions-select\"]": "<figure class=\"align-default\" id=\"aaf-institutions-select\">\n<a class=\"reference internal image-reference\" href=\"../../_images/aaf-institutions-select.png\"><img alt=\"../../_images/aaf-institutions-select.png\" src=\"../../_images/aaf-institutions-select.png\" style=\"width: 300px;\"/></a>\n<figcaption>\n<p><span class=\"caption-number\">Fig. 28.8 </span><span class=\"caption-text\">Select your institution from the AAF list</span><a class=\"headerlink\" href=\"#aaf-institutions-select\" title=\"Link to this image\">#</a></p>\n</figcaption>\n</figure>", "a[href=\"#iiif-manifest-download\"]": "<figure class=\"align-default\" id=\"iiif-manifest-download\">\n<a class=\"reference internal image-reference\" href=\"../../_images/iiif-manifest-download.png\"><img alt=\"../../_images/iiif-manifest-download.png\" src=\"../../_images/iiif-manifest-download.png\" style=\"width: 600px;\"/></a>\n<figcaption>\n<p><span class=\"caption-number\">Fig. 28.13 </span><span class=\"caption-text\">Right click on the file</span><a class=\"headerlink\" href=\"#iiif-manifest-download\" title=\"Link to this image\">#</a></p>\n</figcaption>\n</figure>", "a[href=\"#getting-the-collections-nla-obj-identifier\"]": "<h3 class=\"tippy-header\" style=\"margin-top: 0;\">Getting the collection\u2019s <code class=\"docutils literal notranslate\"><span class=\"pre\">nla.obj</span></code> identifier<a class=\"headerlink\" href=\"#getting-the-collections-nla-obj-identifier\" title=\"Link to this heading\">#</a></h3><p>Once you\u2019ve found the collection\u2019s landing page you need to copy its <code class=\"docutils literal notranslate\"><span class=\"pre\">nla.obj</span></code> identifier. You can find the identifier in a couple of places.</p><p>If the page has a <strong>Cite</strong> button or tab, click on it to reveal more information about the collection, including the identifier.</p>", "a[href=\"#what-is-iiif\"]": "<h3 class=\"tippy-header\" style=\"margin-top: 0;\">What is IIIF?<a class=\"headerlink\" href=\"#what-is-iiif\" title=\"Link to this heading\">#</a></h3><p>The <a class=\"reference external\" href=\"https://iiif.io/\">International Image Interoperability Framework</a>, more conveniently known as IIIF, develops open standards for sharing digital objects, such as images. IIIF platforms and standards are used by GLAM organisations around the world to deliver their image collections online.</p><p>Once you have standards for sharing image metadata, people can build tools that work across collections. For example, <a class=\"reference external\" href=\"https://universalviewer.io/\">Universal Viewer</a> and <a class=\"reference external\" href=\"https://projectmirador.org/\">Mirador</a> are both richly featured, open source, community developed image viewing platforms.</p>", "a[href=\"#tropy-iiif-settings\"]": "<figure class=\"align-default\" id=\"tropy-iiif-settings\">\n<a class=\"reference internal image-reference\" href=\"../../_images/tropy-iiif-settings.png\"><img alt=\"../../_images/tropy-iiif-settings.png\" src=\"../../_images/tropy-iiif-settings.png\" style=\"width: 600px;\"/></a>\n<figcaption>\n<p><span class=\"caption-number\">Fig. 28.18 </span><span class=\"caption-text\">Create a new profile in the IIIF plugin settings.</span><a class=\"headerlink\" href=\"#tropy-iiif-settings\" title=\"Link to this image\">#</a></p>\n</figcaption>\n</figure>", "a[href=\"#tropy-interface\"]": "<figure class=\"align-default\" id=\"tropy-interface\">\n<a class=\"reference internal image-reference\" href=\"../../_images/tropy-interface.png\"><img alt=\"../../_images/tropy-interface.png\" src=\"../../_images/tropy-interface.png\" style=\"width: 600px;\"/></a>\n<figcaption>\n<p><span class=\"caption-number\">Fig. 28.1 </span><span class=\"caption-text\">The Tropy interface showing photographs imported from the B.A.N.Z. Antarctic Research Expedition photographs (<a class=\"reference external\" href=\"https://nla.gov.au/nla.obj-141170265\">https://nla.gov.au/nla.obj-141170265</a>).</span><a class=\"headerlink\" href=\"#tropy-interface\" title=\"Link to this image\">#</a></p>\n</figcaption>\n</figure>", "a[href=\"#collection-url-identifier\"]": "<figure class=\"align-default\" id=\"collection-url-identifier\">\n<a class=\"reference internal image-reference\" href=\"../../_images/collection-url-identifier.png\"><img alt=\"../../_images/collection-url-identifier.png\" src=\"../../_images/collection-url-identifier.png\" style=\"width: 600px;\"/></a>\n<figcaption>\n<p><span class=\"caption-number\">Fig. 28.5 </span><span class=\"caption-text\">Your browser\u2019s location bar includes the identifier of the current page.</span><a class=\"headerlink\" href=\"#collection-url-identifier\" title=\"Link to this image\">#</a></p>\n</figcaption>\n</figure>", "a[href=\"#tropy-vocabs\"]": "<figure class=\"align-default\" id=\"tropy-vocabs\">\n<a class=\"reference internal image-reference\" href=\"../../_images/tropy-vocabs.png\"><img alt=\"../../_images/tropy-vocabs.png\" src=\"../../_images/tropy-vocabs.png\" style=\"width: 600px;\"/></a>\n<figcaption>\n<p><span class=\"caption-number\">Fig. 28.15 </span><span class=\"caption-text\">Click on the plus sign to add a new vocabulary</span><a class=\"headerlink\" href=\"#tropy-vocabs\" title=\"Link to this image\">#</a></p>\n</figcaption>\n</figure>", "a[href=\"#collection-breadcrumbs\"]": "<figure class=\"align-default\" id=\"collection-breadcrumbs\">\n<a class=\"reference internal image-reference\" href=\"../../_images/collection-breadcrumbs.png\"><img alt=\"../../_images/collection-breadcrumbs.png\" src=\"../../_images/collection-breadcrumbs.png\" style=\"width: 600px;\"/></a>\n<figcaption>\n<p><span class=\"caption-number\">Fig. 28.3 </span><span class=\"caption-text\">An photo within the B.A.N.Z. Antarctic Research Expedition collection (<a class=\"reference external\" href=\"https://nla.gov.au/nla.obj-141171021\">https://nla.gov.au/nla.obj-141171021</a>) \u2013 clicking on the breadcrumb link will take you up to the collection landing page.</span><a class=\"headerlink\" href=\"#collection-breadcrumbs\" title=\"Link to this image\">#</a></p>\n</figcaption>\n</figure>", "a[href=\"#collection-album-landing\"]": "<figure class=\"align-default\" id=\"collection-album-landing\">\n<a class=\"reference internal image-reference\" href=\"../../_images/collection-album-landing.png\"><img alt=\"../../_images/collection-album-landing.png\" src=\"../../_images/collection-album-landing.png\" style=\"width: 600px;\"/></a>\n<figcaption>\n<p><span class=\"caption-number\">Fig. 28.2 </span><span class=\"caption-text\">The landing page for the B.A.N.Z. Antarctic Research Expedition photographs (<a class=\"reference external\" href=\"https://nla.gov.au/nla.obj-141170265\">https://nla.gov.au/nla.obj-141170265</a>)</span><a class=\"headerlink\" href=\"#collection-album-landing\" title=\"Link to this image\">#</a></p>\n</figcaption>\n</figure>", "a[href=\"#create-manifest-after\"]": "<figure class=\"align-default\" id=\"create-manifest-after\">\n<a class=\"reference internal image-reference\" href=\"../../_images/create-manifest-after.png\"><img alt=\"../../_images/create-manifest-after.png\" src=\"../../_images/create-manifest-after.png\" style=\"width: 600px;\"/></a>\n<figcaption>\n<p><span class=\"caption-number\">Fig. 28.11 </span><span class=\"caption-text\">Change <code class=\"docutils literal notranslate\"><span class=\"pre\">v3</span></code> to <code class=\"docutils literal notranslate\"><span class=\"pre\">v2</span></code> and insert your collection\u2019s identifier as shown</span><a class=\"headerlink\" href=\"#create-manifest-after\" title=\"Link to this image\">#</a></p>\n</figcaption>\n</figure>", "a[href=\"#iiif-nb-jupyterlab\"]": "<figure class=\"align-default\" id=\"iiif-nb-jupyterlab\">\n<a class=\"reference internal image-reference\" href=\"../../_images/iiif-nb-jupyterlab.png\"><img alt=\"../../_images/iiif-nb-jupyterlab.png\" src=\"../../_images/iiif-nb-jupyterlab.png\" style=\"width: 600px;\"/></a>\n<figcaption>\n<p><span class=\"caption-number\">Fig. 28.10 </span><span class=\"caption-text\">The notebook running in Jupyter Lab.</span><a class=\"headerlink\" href=\"#iiif-nb-jupyterlab\" title=\"Link to this image\">#</a></p>\n</figcaption>\n</figure>", "a[href=\"#install-the-bibo-vocabulary\"]": "<h3 class=\"tippy-header\" style=\"margin-top: 0;\">Install the BIBO vocabulary<a class=\"headerlink\" href=\"#install-the-bibo-vocabulary\" title=\"Link to this heading\">#</a></h3><p>Tropy comes equipped with a number of commonly-used metadata vocabularies. However, it\u2019s currently missing <a class=\"reference external\" href=\"https://dcmi.github.io/bibo/\">BIBO (the Bibliographic Ontology)</a>.</p>", "a[href=\"#using-mybinder\"]": "<h4 class=\"tippy-header\" style=\"margin-top: 0;\">Using MyBinder<a class=\"headerlink\" href=\"#using-mybinder\" title=\"Link to this heading\">#</a></h4><p>To use the MyBinder service, click on the MyBinder tab under the notebook preview. You should see a big, blue <strong>Run live on MyBinder</strong> button. Click on the button to launch the Binder service. No login is required, so MyBinder immediately starts building a customised computing environment. This can take a while, but eventually the notebook should load in the Jupyter Lab interface.</p>", "a[href=\"#importing-the-manifest-into-tropy\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Importing the manifest into Tropy<a class=\"headerlink\" href=\"#importing-the-manifest-into-tropy\" title=\"Link to this heading\">#</a></h2><p>To import your Trove collection manifest into Tropy:</p>", "a[href=\"#set-the-iiif-import-plugin-to-use-the-trove-template\"]": "<h3 class=\"tippy-header\" style=\"margin-top: 0;\">Set the IIIF Import plugin to use the Trove template<a class=\"headerlink\" href=\"#set-the-iiif-import-plugin-to-use-the-trove-template\" title=\"Link to this heading\">#</a></h3><p>Finally, you need to tell the IIIF import plugin to use the new template. This will ensure that the metadata fields are mapped correctly when you import a new Trove manifest.</p>", "a[href=\"#mybinder-tab\"]": "<figure class=\"align-default\" id=\"mybinder-tab\">\n<a class=\"reference internal image-reference\" href=\"../../_images/mybinder-tab.png\"><img alt=\"../../_images/mybinder-tab.png\" src=\"../../_images/mybinder-tab.png\" style=\"width: 600px;\"/></a>\n<figcaption>\n<p><span class=\"caption-number\">Fig. 28.9 </span><span class=\"caption-text\">Click on the MyBinder tab.</span><a class=\"headerlink\" href=\"#mybinder-tab\" title=\"Link to this image\">#</a></p>\n</figcaption>\n</figure>", "a[href=\"#configuring-tropy-optional\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Configuring Tropy (optional)<a class=\"headerlink\" href=\"#configuring-tropy-optional\" title=\"Link to this heading\">#</a></h2><p>The <a class=\"reference external\" href=\"https://glam-workbench.net/trove-images/save-image-collection-iiif/\">Save a collection of digitised images as an IIIF manifest</a> notebook tries to save useful metadata describing each item in a collection (as well as the collection itself). Besides the title, the metadata fields it looks for are:</p>", "a[href=\"#running-the-notebook\"]": "<h3 class=\"tippy-header\" style=\"margin-top: 0;\">Running the notebook<a class=\"headerlink\" href=\"#running-the-notebook\" title=\"Link to this heading\">#</a></h3><p>Go to <a class=\"reference external\" href=\"https://glam-workbench.net/trove-images/save-image-collection-iiif/\">Save a collection of digitised images as an IIIF manifest</a> in the Trove images section of the GLAM Workbench.</p><p>This notebook, like all GLAM Workbench notebooks, needs to be run in a customised computing environment. The easiest way to do this is through BinderHub. BinderHub is a cloud-based service that gets a notebook up and running by reading its requirements from a code repository, and creating an environment with the necessary software. The GLAM Workbench is integrated with two BinderHub services:</p>", "a[href=\"#installing-tropy-and-the-iiif-manifest-plugin\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Installing Tropy and the IIIF Manifest plugin<a class=\"headerlink\" href=\"#installing-tropy-and-the-iiif-manifest-plugin\" title=\"Link to this heading\">#</a></h2><p>If you haven\u2019t already, download and install Tropy from the <a class=\"reference external\" href=\"https://tropy.org/\">Tropy home page</a>. For an introduction to using Tropy, see the <a class=\"reference external\" href=\"https://docs.tropy.org/using-tropy/intro-to-the-interface\">documentation section</a>.</p><p>To import IIIF manifests into Tropy yoou need to install the <a class=\"reference external\" href=\"https://github.com/tropy/tropy-plugin-iiif\">IIIF plugin</a>:</p>", "a[href=\"#using-ardc-binder\"]": "<h4 class=\"tippy-header\" style=\"margin-top: 0;\">Using ARDC Binder<a class=\"headerlink\" href=\"#using-ardc-binder\" title=\"Link to this heading\">#</a></h4><p>To use the ARDC Binder service, click on the ARDC Binder tab under the notebook preview. You should see a big, blue <strong>Run live on ARDC Binder</strong> button. Click on the button to launch the Binder service.</p><p>If this is the first time you\u2019ve used the ARDC Binder service you\u2019ll be asked to login using the Australian Access Federation (AAF).</p>"}
skip_classes = ["headerlink", "sd-stretched-link", "sd-rounded-pill"]

window.onload = function () {
    for (const [select, tip_html] of Object.entries(selector_to_html)) {
        const links = document.querySelectorAll(`article.bd-article ${select}`);
        for (const link of links) {
            if (skip_classes.some(c => link.classList.contains(c))) {
                continue;
            }

            tippy(link, {
                content: tip_html,
                allowHTML: true,
                arrow: true,
                placement: 'auto-start', maxWidth: 500, interactive: false,

            });
        };
    };
    console.log("tippy tips loaded!");
};
